import React from 'react';
import styles from './SlideForm.module.css';
import RoundButton from '../Util/RoundButton';

export default function SlideForm(props) {
    return (
        <div className={`${styles.slide} ${!props.isLogin && styles.slide_animation}`}>
            <RoundButton onClick={this.props.slideClickHandler} color={'#487fec'} bgcolor={'white'} type={'text'} value={'Xin chao'} />
        </div>
    )
}
